.
➡️Un truco simple y sencillo para activar y maximizar las fibras musculares de los tríceps es pretender separar la barra del medio cuando se está haciendo algún tipo de press de banca. En otras palabras, hay que hacer como si uno fuera a romper la barra por el medio. Lo puedes hacer ya sea en pecho inclinado, declinado o plano con barra. Esta técnica ayuda a reclutar de una forma más eficiente el músculo, y por ende ayuda a acelerar los resultados de la hipertrofia muscular.
.
➡️Para saber si de verdad estás actividando los músculos eficientemente trata de poner una banda elástica alrededor de tus muñecas. Vas a sentir la tensión en tu espalada superior y estabilidad en trapecios y hombros. Cuando sientas esto, apreta la barra como si la fueras a romperla y separarla en dos partes.
.
➡️También, esta es una forma de enseñarle a los principiantes la técnica correcta de realizar un press con barra. Así aprenden desde el día uno la tensión que deben ejercer en sus hombros, espalda y trapecios para evitar posibles lesiones y de esta forma se garantiza una técnica adecuada.
.
