Voilà pour la petite histoire, maintenant je me consacre à mes coachings, j’essaie de leur apprendre avec passion et de leur éviter les erreurs que j’ai pu faire et qui au final n’ont fait que freiner ma progression..
Je termine en remerciant mon ami @tristan_bno mine de connaissances à qui j’ai remis ma confiance pour me guider sur ma sèche et avec qui je vais continuer à bosser durant ma prise de masse car on a fait du bon boulot ensemble! Tout le monde même les meilleurs dans tous les cas ont besoin d un œil extérieur pour progresser j’en suis convaincu! 
Merci à vous de m’avoir lu et merci à mes élèves pour leur confiance 🙏
