Recently my activity levels have been shockingly low. ⁣
⁣
Driving my car everywhere with minimum walking has a negative impact on my body in terms of body fat.⁣
⁣
When I didn’t drive I was in the best shape of my life as it was easier for me to burn calories keeping me leaner through the amount of walking I did.⁣
⁣
I kind of miss that, so I decided to buy a bike and get some miles in.⁣
⁣
Not only will this help keep me active and burn calories, its actually fun to do especially going to the most scenic places.⁣
⁣
Here’s my 3 tips on burning extra calories through cardio:⁣
⁣
1. ☑️DO WHAT YOU ENJOY. cardio doesn’t need to be overthought, literally walk your dogs, go on a bike ride, run , jog, sprint, box, swim or whatever makes you happy at the time. It all burns calories.⁣
⁣
2. ☑️SWITCH UP INTENSITY WITH YOUR CARDIO. Some days challenge your self with a more high intensity workout so that you can really get your heart rate up and strengthen your heart. Also you’ll get fitter as a result.⁣
⁣
3. ☑️MOST IMPORTANTLY: cardio will not make you a lean greek God. Its only 10% of the equation, the other 90% is nutrition. No one wants to hear that though do they ? Haha. That tells you if you spent 90% of your efforts nailing your nutrition and 10% on the cardio, you would in fact be the greek God!⁣
⁣
What’s your favourite form of cardio and why ? ⁣🔻🔻🔻 comment below.

